import React from 'react';
import styles from './Services.module.css';
import aos from 'aos';
import 'aos/dist/aos.css';


const services = (props) => (
    <div data-aos-easing='ease-out' className={styles.Services}>
        <a href={props.link}><img src={props.img} /><p>{props.title}</p></a>
    </div>
)

export default services;
